import { useEffect, useState } from "react";

function App() {
const [message, setMessage] = useState('')

  useEffect(()=> {
    const getTodos = async () => {
      const res = await fetch('/api/todos');
      const todos = await res.json();

      setMessage(todos.msg)
      console.log(todos);
    };
    getTodos();
  },[])

  return (
    <main className='conatiner'>
      <h1>MERN TODO</h1>
      {message && <p>{message}</p>}
    </main>
  );
}

export default App;
